import React from "react";
import "./style.css";
import articleData from "./articledata";
impo
import Navbar from "./Navbar";
import Headline from "./Headline";
import Article from "./Article";

class App extends React.Component {
  render() {
    const cat = articleData[0].instructions.map(item => <li>{item}</li>);

    return (
      <div>
        <Navbar />
        <div id="nav-filler"></div>
        <Headline />
        <Article
          category={articleData[0].category}
          title={articleData[0].title}
          subtitle={articleData[0].subtitle}
          description={articleData[0].description}
          instructions={cat}
          img={articleData[0].img}
          alt={articleData[0].alt}
        />
        {console.log(articleData[0].img)}
      </div>
    );
  }
}

export default App;
